        void CreateUsers(ModelBuilder modelBuilder)
        {
            modelBuilder.Entity<User>(entity =>
            {
                entity.HasKey(u => u.UserId);

                entity.Property(e => e.UserName)
                    .IsRequired()
                    .HasMaxLength(32)
                    .IsUnicode(false);
                entity.Property(e => e.Password).IsRequired();
                entity.Property(e => e.FirstName).IsRequired().HasMaxLength(32);
                entity.Property(e => e.LastName).IsRequired().HasMaxLength(32);
                entity.Property(e => e.Email).IsRequired().HasMaxLength(64);
                entity.Property(e => e.ImageName).IsRequired().HasMaxLength(32);
                entity.Property(e => e.ImageData).IsRequired();
            });

            modelBuilder.Entity<User>().HasIndex(u => u.UserName).IsUnique();

            var ph = new PasswordHasher<User>();
            modelBuilder.Entity<User>().HasData(new User[]
            {
                CreateUser(1, "Admin", "Admin", "Admin", "Admin123",
                    "email1@gmail.com", "", "", 1, ph),
                CreateUser(2, "User", "User", "User", "User1234",
                    "email2@gmail.com", "", "", 2, ph)
            });
        }

        User CreateUser(int id, string userName, string firstName, string lastName,
            string password, string email, string imageName, string imageData,
            int roleID, PasswordHasher<User> ph)
        {
            User user = new User
            {
                UserId = id,
                UserName = userName,
                FirstName = firstName,
                LastName = lastName,
                Email = email,
                ImageName = imageName,
                ImageData = imageData,
                RoleId = roleID
            };
            user.Password = ph.HashPassword(user, password);
            return user;
        }

